import React, { Component } from 'react';
/*import logo from './logo.svg';
//import './App.css'; */
import Empl from  './components/employee_details'
import { Navbar, NavbarBrand, Nav, NavItem, NavLink} from "reactstrap";
class App extends Component {
    constructor(props){
        super(props)
        this.toggle =  this.toggle.bind(this)
        this.state = {
            activeTab : '1'
        }
    }
    toggle(tab){
        if(this.state.activeTab !== tab) {
            this.setState({activeTab: tab})
        }
    }
  render() {
    return (
        <div>
                <Navbar className= "bg-faded">
                    <NavbarBrand href = "/" className= "align-content-between">Powerpay</NavbarBrand>
                    <Nav className="m1" tabs>
                        <NavItem>
                            <NavLink onClick={()=>this.toggle('1')}> Registration </NavLink>
                        </NavItem>
                        <NavItem>
                            <NavLink onClick={this.toggle('2')}> Preview </NavLink>
                        </NavItem>
                        <NavItem>
                            <NavLink onClick={this.toggle('3')}> Employee Details </NavLink>
                        </NavItem>
                    </Nav>
                </Navbar>
          </div>
    );
  }
}

export default App;
